import React, { useState } from "react";



const Home = () => {
    var time2 = new Date().toLocaleTimeString(); 

    const [time ,setTime] = useState(time2);

    const clicks = () => {
        time2 = new Date().toLocaleTimeString();
        setTime(time2);
    }
    setInterval(clicks,1000);
    return (
        <div className="row py-5">
       
        <div className="col-md-6 order-2 order-md-1">
            <h1 className="text-center">We are the best developer of our time</h1>
            <h3 onClick="clicks">{time}</h3>
        </div>
        <div className="col-md-6 order-1 order-md-2">
            

        </div>

        </div>

        
    );
}

export default Home;
